import React from 'react';
import { Link } from 'react-router-dom';
import { useParams } from 'react-router-dom';


const CameraFeed = ({ robot }) => {

    const { id } = useParams()

    return (
        <div className="bg-gray-100 rounded-md shadow-lg p-4">
            <h2 className="font-bold mb-4">Camera Feed for Robot</h2>
            <div className="flex items-center justify-center bg-gray-300 h-80 rounded-md">
                <p className="text-lg font-bold text-gray-500">Video is currently not available</p>
            </div>

            <Link to={`/robots/${id}`} className="mt-4 bg-blue-600 hover:bg-blue-700 text-white py-2 px-4 rounded-md">
                Back to Robot
            </Link>
        </div>
    );
};

export default CameraFeed;
